import { Container } from "react-bootstrap";

let cartMovies = ({movie}) => {
    return (
        <div className="wrapper-Movies">
            <div className="cart">
                    <img src={ "https://image.tmdb.org/t/p/w0/"+movie.backdrop_path} />
                    <div className="infoMoveis">
                        <h5>movie</h5>
                    </div>
            </div>
        </div>
    )
}

export default cartMovies
